    const { authenticated, handleLogout } = useContext(Context);

    console.log("Situação do usuário na página dashboard: " + authenticated);

    return (
        <div>
            <Link to="/das">Dashboard</Link><br/>


            <h1>Dashboard</h1>
            <button type="button" onClick={handleLogout}>Sair</button>
        </div>
    );
}
